I switched my __eq__ and __hash__ methods for my "tuple" class but the order doesn't match the answers
Do these look right?
    ```def __eq__(self, row: 'Row') -> bool:
        if type(row) != Row:
            return False

        if self.__values != row.get_values():
            return False
        return True


    def __hash__(self) -> int:
        return hash(tuple(self.__values))```

